impl Solution {
    pub fn string_count(n: i32) -> i32 {
        const MOD: i64 = 1_000_000_007;
        if n < 4 {
            return 0;
        }
        let mut dp = vec![0i64; (n + 1) as usize];
        dp[0] = 1;
        for i in 1..=n as usize {
            dp[i] = 26 * dp[i - 1] % MOD;
            if i >= 4 {
                let mut add = 1;
                for j in 1..=i - 4 {
                    add = (add * 26) % MOD;
                }
                dp[i] = (dp[i] + add) % MOD;
            }
        }
        let mut fact = 1;
        for i in 1..=4 {
            fact = fact * i % MOD;
        }
        let result = dp[n as usize] * fact % MOD;
        result as i32
    }
}
